import React from 'react';

const Navbar = () => {
    return (
        <nav className="nav bg-light">
            <div className="d-flex w-100 justify-content-center">
                <Route className="nav-link" to="/">Home</Route>
                <Route className="nav-link" to="/buttons">Buttons</Route>
                <Route className="nav-link" to="/forms">Forms</Route>
                <Route className="nav-link" to="/list">List</Route>
                <Route className="nav-link" to="/modal">Modal</Route>
            </div>
        </nav>
    );
};

export default Navbar;
